INSERT INTO `competency` VALUES (1,'Self Awareness','Exhibits knowledge of personal values, strengths, shortcomings, and developmental opportunities. Uses self-assessment strategies to inform personal growth and development','2018-02-11 05:11:01','2018-02-11 05:11:01'),(2,'Intentional Learning','Has knowledge of personal learning style and leverages this knowledge to enhance personal performance, knowledge of self, others, and leadership ability','2018-02-11 05:11:01','2018-02-11 05:11:01'),(3,'Effective Communication','Has the ability to communicate effectively through a variety of methods and media and within a range of contexts.','2018-02-11 05:11:01','2018-02-11 05:11:01'),(4,'Relational Development','Creates a positive, welcoming environment; sees issues from multiple points of view; and builds effective inter- and intra-group relationships','2018-02-11 05:11:01','2018-02-11 05:11:01'),(5,'Embrace Diversity & Difference','Recognizes the value of different perspectives, skillsets, and people; is able to facilitate productive outcomes in diverse groups','2018-02-11 05:11:01','2018-02-11 05:11:01'),(6,'Engaging Leadership','Enables others to step up and lead; creates conditions for others to shine; generates collective commitment and learning','2018-02-11 05:11:01','2018-02-11 05:11:01'),(7,'Directive Leadership','Coordinates members and maintains accountability for effective outcomes. Sets direction, communicates expectations, and monitors progress','2018-02-11 05:11:01','2018-02-11 05:11:01'),(8,'Champions Effective Processes','Establishes systems and processes that facilitate efficient and effective outcomes','2018-02-11 05:11:01','2018-02-11 05:11:01'),(9,'Problem Solving','Facilitates effective problem identification and solving strategies; identifies and cultivates resources; delivers results','2018-02-11 05:11:01','2018-02-11 05:11:01'),(10,'Strategic Perspective','Able to evaluate issues from multiple perspectives and identify the core problem; considers options and trade-offs; makes effective use of resources.','2018-02-11 05:11:01','2018-02-11 05:11:01'),(11,'Ethics & Integrity','Knowledgeable of and committed to a meaningful set of ethical guidelines and principles. Actions are consistent with personal values','2018-02-11 05:11:01','2018-02-11 05:11:01'),(12,'Innovative Spirit','Displays the courage to initiate positive change, is innovative, and will risk failing in front of peers','2018-02-11 05:11:01','2018-02-11 05:11:01');
/*!40000 ALTER TABLE `competency` ENABLE KEYS */;
