ies helped you to be effective in the role? What personal qualities made you less effective? Describe your leadership style?\"}]}','Practical Experience',NULL,NULL),(8,1,'Take a <a target=\"_blank\" href=\"https://www.123test.com/personality-test/\">Personality Assessment</a> and discover your personality type.','form','{\"questions\":[{\"type\":\"text\",\"body\":\"What is your personality type? Describe your personality in your own words.\"}]}','Practical Experience',NULL,NULL),(9,1,'Know your learning style. Visit the Hart Center. To set an appointment email <a target=\"_blank\" href=\"mailto:khubbard@smu.edu\">Kathy Hubbard</a>','string','{\"questions\":[{\"type\":\"text\",\"body\":\"What did you learn about your learning style?\"}]}','Practical Experience',NULL,NULL),(10,1,'Visit Hart Center to find out about upcoming Seminars & Workshops.','string','','Formal Training',NULL,NULL),(11,1,'Do the <a target=\"_blank\" href=\"http://thegoodproject.org/toolkits-curricula/the-goodwork-toolkit/value-sort-activity/\">Value Sort Activity</a> and record top 4 Values.','form','{\"questions\":[{\"type\":\"text\",\"body\":\"Enter your top four values.\"}]}','Coaching and Training',NULL,NULL),(12,2,'View all videos in the competency library and answer quiz.','link','{\"link\":\"#/library/intentional-learning?type=video\"}','Formal Training',NULL,'2018-05-03 20:46:42'),(13,2,'Go through recommended books and additional resources.','link','{\"link\":\"#/library/intentional-learning?type=additional\"}','Formal Training',NULL,NULL),(14,2,'Answer final quiz to complete the formal training.','form','{\"questions\":[{\"type\":\"text\",\"body\":\"What did you learn from the resources?\"},{\"type\":\"text\",\"body\":\"How will you apply it?\"}]}','Formal Training',NULL,NULL),(15,2,'a. Contact the Hart Center to take the The Learning Tactics Inventory.   b. Log your learning style','form','{\"questions\":[{\"type\":\"text\",\"body\":\"Do you agree with the learning style? Why or Why no